import React from "react";
import './intro.css';

const Intro = () => {
    return (
        <section id="intro">
            <div className="introContent">
                <text style={{ whiteSpace: 'pre-line' }} className="hello"> Hello,<br /></text>
                <p className="introtext"> I'm a web super programmer</p>

            </div>
        </section>
    )
}

export default Intro;
